  return (
    <li>
        {HighPriority.map((todo) => {
          return <TodoList key={todo} todo={todo} />;
        })}
      <input type="checkbox" className="inputBox" /> I need to {props.todo}
    </li>
  );
};

const HighPriority = [
    "do Danish homework",
    "do React homework",
    "grocery shop",
  ];

export default TodoList;
